jobDescribe:
岗位职责：
1.分析客户需求，完成项目相关的需求文档编写;
2.完成项目相关设计开发文档的整理与编写;
3.完成程序开发、调试、测试等实施工作;
4.分析开发过程中遇到问题，优化解决方案;
5.完成相关技术调研工作，将相关技术引入开发工作中:
6.定期进行总结，对实现方案及产品提出升级、改进等建议。
任职资格：
1.本科及以上学历，计算机、电子信息、自动化、数学等相关理工类专业; 
2.1年及以上开发工作经验，熟练使用Java编程语言，能够独立完成模块开发，具有独自解决问题能力;
3.熟练使用前端技术开发技术，熟悉HTML5、CSS/CSS3.VUE等;
4.熟悉主流开发框架如SpringMVC.SpringBoot和SpringCloud;
5.掌握基础SQL命令熟悉Oracle、Mysql等主流数据库;
6.掌握软件技术文档的编写，具备良好的文档编制习惯和代码书写规范;
7.良好的逻辑思维和沟通协作能力，有责任心学习能力强，抗压能力强;
8.有C++开发经验者优先。

工作职责 
1、主导机器人从设计到上线全流程,负责撰写和审核产品设计、需求文档,协同相关团队的项目管理进行产品的落地; 
2、根据产品需求，撰写详细的产品流程设计文档及原型设计文档;
3、挖掘客户需求/业务痛点,掌握竞争对手动态和市场动态; 
4、根据不同业务场景(BPO)，调研设计RPA产品的应用和功能; 
5、对流程相关数据进行监控,提供客户支持,提升整体产品的用户满意度;
6、项目管理及客户关系管理;

要求 
1、需要有AI 项目经验，熟悉例如 市场上的 AI 模型- Baidu Earnibot/Ali Tongyi Qianwen/ 百川/ 科大讯飞 ；模型精调。
2、Java熟练；
3、精通自动化项目设计的相关流程,包括功能分析、角色分析、原型设计、界面开发、易用性测试等;
4、 对项目管理，项目周期熟悉运作。负责项目成本，周期以及质量;
5、对自动化技术/方案有丰富的设计经验,对新鲜事物有足够的敏感度,富有创意; 
6、好的逻辑思维与分析能力,能够很好的规划和设计产品功能、使用流程与交互体验; 
7、商务部分，两年以上客户关系维护的经验；
8、英语workable；
9、熟悉RPA工具(Automation Anywhere/Uipath/Uibot/Blue Prism/VBA/Python/Java/Power Automate )者优先考虑;
